ttributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1276","type":"Line"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000.0,"min_interval":3600000.0,"num_minor_ticks":0},"id":"1324","type":"AdaptiveTicker"},{"attributes":{"child":{"id":"1075"},"title":"Worker Profile (administrative)"},"id":"1404","type":"Panel"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n        &lt;h2&gt; Duration: 33.87 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 153 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 14.27 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 3.02 s &lt;/li&gt;\n&lt;li&gt; transfer time: 174.19 ms &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.8.162:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 4 &lt;/li&gt;\n          &lt;li&gt; Threads: 96 &lt;/li&gt;\n          &lt;li&gt; Memory: 690.94 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][::2]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"blue"},"hatch_alpha":{"value":0.2},"hatch_color":{"value":"blue"},"height":{"value":0.9},"line_alpha":{"value":0.2},"line_color":{"value":"blue"},"width":{"field":"bandwidth"},"x":{"field":"bandwidth-half"},"y":{"field":"type"}},"id":"1204","type":"Rect"},{"attributes":{},"id":"1316","type":"AllLabels"},{"attributes":{},"id":"1222","type":"LinearScale"},{"attributes":{"botto
